$(document).ready(function () {
    // maker
    $(".select-departamento").each(function (i,v) {
        var options = '<option value="">Elegir Departamento</option>';
        for (var i in states) {
            var state = states[i];
            options += '<option value="'+state.code+'">'+state.name+'</option>';
        }
        $(v).html(options);

    });

    $(".select-departamento").click(function (e) {
        var codigo = $.trim($(this).val());
        if (codigo != "") {
            var options = '<option value="">Elegir Provincia</option>';
            var provincia = $(this).parents('div.panel-body').find('.select-provincia');
            for (var i in cities) {
                var city = cities[i];
                if (city.state == codigo) {
                    options += '<option value="'+city.code+'">'+city.name+'</option>';
                }
            }
             $(provincia).html(options);
        }

    });

    $(".select-provincia").click(function (e) {
        var codigo = $(this).val();
        if (codigo != "") {
            var options = '<option value="">Elegir Distrito</option>';
            var distrito = $(this).parents('div.panel-body').find('.select-distrito');
            for (var i in districts) {
                var district = districts[i];
                if (district.city == codigo) {
                    options += '<option value="'+district.code+'">'+district.name+'</option>';
                }
            }
             $(distrito).html(options);
        }
    });
});

function SortByName(a, b){
  var aName = a.name.toLowerCase();
  var bName = b.name.toLowerCase();
  return ((aName < bName) ? -1 : ((aName > bName) ? 1 : 0));
}